  `update_time` datetime DEFAULT NULL,
  `company_id` varchar(40) DEFAULT NULL,
  `company_name` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

