/*Table structure for table `co_export` */

DROP TABLE IF EXISTS `co_export`;

CREATE TABLE `co_export` (
  `id` varchar(40) NOT NULL,
  `input_date` datetime DEFAULT NULL,
  `contract_ids` varchar(200) DEFAULT NULL COMMENT 'ID集合串\\n            \\n            x,y,z',
  `customer_contract` varchar(200) DEFAULT NULL COMMENT '客户的合同号,可选择多个合同',
  `lcno` varchar(10) DEFAULT NULL COMMENT 'L/C T/T',
  `consignee` varchar(100) DEFAULT NULL,
  `marks` varchar(255) DEFAULT NULL,
  `shipment_port` varchar(100) DEFAULT NULL,
  `destination_port` varchar(100) DEFAULT NULL,
  `transport_mode` varchar(10) DEFAULT NULL COMMENT 'SEA/AIR',
  `price_condition` varchar(10) DEFAULT NULL COMMENT 'FBO/CIF',
  `remark` varchar(100) DEFAULT NULL,
  `box_nums` decimal(11,0) DEFAULT NULL COMMENT '冗余，为委托服务，一个报运的总箱数',
  `gross_weights` decimal(10,2) DEFAULT NULL COMMENT '冗余，为委托服务，一个报运的总毛重',
  `measurements` decimal(10,2) DEFAULT NULL,
  `state` decimal(11,0) DEFAULT NULL COMMENT '0-草稿 1-已上报 2-装箱 3-委托 4-发票 5-财务',
  `pro_num` int(11) DEFAULT NULL,
  `ext_num` int(11) DEFAULT NULL,
  `create_by` varchar(40) DEFAULT NULL,
  `create_dept` varchar(40) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `company_id` varchar(40) DEFAULT NULL,
  `company_name` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`id`)
